import React from 'react';
import couple from '../photos/couple.jpg'
import styled from 'styled-components'

const Img = styled.img`
width:100vh
`
function Hero() {
    return (
        <div>
            <Img src={couple}></Img>
        </div>
    );
}

export default Hero;
